import { useState } from "react";
import { useNavigate } from "react-router-dom";
// import { Link } from "react-router-dom";

const Wizards = (props) => {
  const navigate = useNavigate();
    console.log(props.wizards)
    const [click,setClick]=useState(false);
  return (
    <div className="containerPotions">
      <button onClick={() => navigate(-1)}><img src="../icons/arrow_back.svg" alt="back"/></button>
      <div className="potionsData">
      <div>
      <h1>Wizards</h1>
        <p>Greatest of the great</p>
      </div>
      <div className="spells">

<table className="spellTable">
  <thead>
      <th>Name</th>
      <th>Incantation</th>
  </thead>
  <tbody>
  {/* <tr>
      <th>{props.input[0].name}</th>
      <th>{props.input[0].incantation}</th>
  </tr> */}
        {props.spells.map((value,index)=>{
          return <tr key={index}>
              <td>{value.name}</td>
              <td>{value.incantation}</td>
          </tr>
      })}
  </tbody>
</table>
</div>

      </div>
    </div>
  );
};

export default Wizards;
